内置的同步锁

这种写法会根据给定对象，自动创建一个锁，并等待块中的代码执行完毕，才释放锁。这段代码本身没什么问题，但是因为 @synchronized(self) 锁的对象是 self，造成共用此锁的同步块阻塞，降低效率。
// someString 属性
// 当 someString 开始读时，对其的写入阻塞，这是合理的；
- (NSString *)someString
{
    @synchronized(self) {
        return _someString;
    }
}
- (NSString *)setSomeString:(NSString *)someString
{
    @synchronized(self) {
        _someString = someString;
    }
}
